import React, {useState} from 'react';
import { TextField, Button, Container, Stack, FormControlLabel, FormControl, FormLabel, FormHelperText, Radio, RadioGroup, Checkbox, FormGroup} from '@mui/material';
import { Link } from "react-router-dom"
 
 
const RegisterForm = () => {
    const [Title, setTitle] = React.useState('');
    const [TitleError, setTitleError] = React.useState(false);
    const [TitleHelperText, setTitleHelperText] = React.useState('Choose the title');

    const [Gender, setGender] = React.useState('');
    const [GenderError, setGenderError] = React.useState(false);
    const [GenderHelperText, setGenderHelperText] = React.useState('Choose the title');
    
    const [firstName, setFirstName] = useState('')
    const [lastName, setLastName] = useState('')
    const [email, setEmail] = useState('')
    const [dateOfBirth, setDateOfBirth] = useState('')
    const [password, setPassword] = useState('')

    const [CheckBox, setChechBox] = React.useState({
        sinhala: false,
        science: false,
        buddhism: false,
        english: false,
        mathematics: false,
        chatholism: false,
        tamil: false,
        it: false,
        history: false,
      });

    const handleTitleChange = (event) => {
        setTitle(event.target.value);
        setTitleHelperText(' ');
        setTitleError(false);
    };

    const handleGenderChange = (event) => {
        setGender(event.target.value);
        setGenderHelperText(' ');
        setGenderError(false);
    };

    const handleCheckBoxChange = (event) => {
        setChechBox({
          ...CheckBox,
          [event.target.name]: event.target.checked,
        });
    };

    const { sinhala, science, buddhism, english, mathematics, chatholism, tamil, it, history } = CheckBox;
    const CheckBoxError = [sinhala, science, buddhism, english, mathematics, chatholism, tamil, it, history].filter((v) => v).length !== 2;
    
 
    function handleSubmit(event) {
        event.preventDefault();

        if (Title === 'mr') {
            setTitleError(false);
            console.log(Title);
          } else if (Title === 'mrs') {
            setTitleError(false);
            console.log(Title);
          } else if (Title === 'ms') {
              setTitleError(false);
              console.log(Title);
          }else {
            setTitleHelperText('Please select an option.');
            setTitleError(true);
            console.log('error');
          }
          
          if (Gender === 'male') {
            setGenderError(false);
            console.log(Gender);
          } else if (Gender === 'female') {
            setGenderError(false);
            console.log(Gender);
          } else {
            setGenderHelperText('Please select an option.');
            setGenderError(true);
            console.log('error');
          }
          
          if (CheckBoxError === false){
            console.log(CheckBox);
          }
          else {
             console.log('error');
         }

        console.log(firstName, lastName, email, dateOfBirth, password) 
    }
 
    return (
        <Container maxWidth="md">
        <React.Fragment>
            <h2>Register Form</h2>
            <form onSubmit={handleSubmit} action={<Link to="/login" />}>
                <Stack spacing={2} direction="row" sx={{marginBottom: 4}}>
                <FormControl fullWidth error={TitleError} variant="standard">
                    <FormLabel id="demo-radio-buttons-group-label">Title</FormLabel>
                        <RadioGroup
                        aria-labelledby="demo-error-radios"
                        name="title"
                        value={Title}
                        onChange={handleTitleChange}
                        row
                        >
                        <FormControlLabel value="mr" control={<Radio />} label="Mr." />
                        <FormControlLabel value="mrs" control={<Radio />} label="Mrs." />
                        <FormControlLabel value="ms" control={<Radio />} label="Ms." />
                        </RadioGroup>
                        <FormHelperText>{TitleHelperText}</FormHelperText>
                </FormControl>
                <FormControl fullWidth error={GenderError} variant="standard">
                    <FormLabel id="demo-radio-buttons-group-label">Gender</FormLabel>
                        <RadioGroup
                        aria-labelledby="demo-error-radios"
                        name="gender"
                        value={Gender}
                        onChange={handleGenderChange}
                        row
                        >
                        <FormControlLabel value="male" control={<Radio />} label="Male" />
                        <FormControlLabel value="female" control={<Radio />} label="Female" />
                        </RadioGroup>
                        <FormHelperText>{GenderHelperText}</FormHelperText>
                </FormControl>
                </Stack>
                <Stack spacing={2} direction="row" sx={{marginBottom: 4}}>
                    <TextField
                        type="text"
                        variant='outlined'
                        color='secondary'
                        label="First Name"
                        onChange={e => setFirstName(e.target.value)}
                        value={firstName}
                        fullWidth
                        required
                    />
                    <TextField
                        type="text"
                        variant='outlined'
                        color='secondary'
                        label="Last Name"
                        onChange={e => setLastName(e.target.value)}
                        value={lastName}
                        fullWidth
                        required
                    />
                </Stack>
                <TextField
                    type="email"
                    variant='outlined'
                    color='secondary'
                    label="Email"
                    onChange={e => setEmail(e.target.value)}
                    value={email}
                    fullWidth
                    required
                    sx={{mb: 4}}
                />
                <TextField
                    type="password"
                    variant='outlined'
                    color='secondary'
                    label="Password"
                    onChange={e => setPassword(e.target.value)}
                    value={password}
                    required
                    fullWidth
                    sx={{mb: 4}}
                />
                <TextField
                    type="date"
                    variant='outlined'
                    color='secondary'
                    label="Date of Birth"
                    onChange={e => setDateOfBirth(e.target.value)}
                    value={dateOfBirth}
                    fullWidth
                    required
                    sx={{mb: 4}}
                />
                <Stack spacing={2} direction="row" sx={{marginBottom: 4}} fullWidth>
                    <FormControl
                        required
                        error={CheckBoxError}
                        component="fieldset"
                        variant="standard"
                        fullWidth
                    >
                        <FormLabel component="legend">Pick two</FormLabel>
                        <FormGroup 
                            row
                        >
                        <FormControlLabel
                            spacing={10}    
                            control={
                            <Checkbox checked={sinhala} onChange={handleCheckBoxChange} name="sinhala" />
                            }
                            label="Sinhala"
                        />
                        <FormControlLabel
                            spacing={10} 
                            control={
                            <Checkbox checked={science} onChange={handleCheckBoxChange} name="science" sx={{ml: 20}}/>
                            }
                            label="Science"
                        />
                        <FormControlLabel
                            spacing={10} 
                            control={
                            <Checkbox checked={buddhism} onChange={handleCheckBoxChange} name="buddhism" sx={{ml: 20}}/>
                            }
                            label="Buddhism"
                        />
                        </FormGroup>
                        <FormGroup 
                            row
                        >
                        <FormControlLabel
                            control={
                            <Checkbox checked={english} onChange={handleCheckBoxChange} name="english" />
                            }
                            label="English"
                        />
                        <FormControlLabel
                            control={
                            <Checkbox checked={mathematics} onChange={handleCheckBoxChange} name="mathematics" sx={{ml: 20}}/>
